import React from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <Container>
        <Row className="align-items-center">
          <Col md={6}>
            <div>
              <h1>Bienvenue à notre salle de sport</h1>
              <p>Nous vous offrons des programmes d'entraînement personnalisés et un accompagnement de qualité pour atteindre vos objectifs de remise en forme.</p>
              <Link to="/about">
                <Button variant="primary">En savoir plus</Button>
              </Link>
            </div>
          </Col>
          <Col md={6}>
            <img src="/gym-image.jpg" alt="Salle de sport" style={{ maxWidth: '100%', height: 'auto' }} />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Home;
